description:
Karaoke Software for PC like Singstar for PS2. It evaluates your singing by analyzing your voice pitch. Songs can be created with integrated editor. This is a fork of the UltraStar project with many improvements, e.g.: Other video sources than just MPEG-1, party mode with the possibility to write your own game modes plugin sdk available), LineBonus, shiny stars, a skin that is quite near to the yet unreleased Singstar for the PS3, etc.

